DROP TABLE IF EXISTS `item_rate_master`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `item_rate_master` (
  `id` int NOT NULL AUTO_INCREMENT,
  `request_id` int DEFAULT NULL COMMENT 'id from purchase_request_master table',
  `vendorId` int DEFAULT NULL,
  `itemId` int DEFAULT NULL,
  `item_rate` double DEFAULT NULL,
  `itemquantity` double DEFAULT NULL,
  `rateGivenOn` date DEFAULT NULL,
  `remark` text,
  `Attachment` text,
  `isShortlisted` tinyint NOT NULL DEFAULT '0',
  `isSentForApproval` tinyint NOT NULL DEFAULT '0' COMMENT '0=no/1=yes',
  `AppReqSentAt` datetime DEFAULT NULL,
  `approvalStatus` tinyint DEFAULT NULL COMMENT '1=pending/2=approved/3=declined',
  `approvedBy` int DEFAULT NULL,
  `approvedAt` datetime DEFAULT NULL,
  `createdBy` int DEFAULT NULL,
  `createdAt` datetime DEFAULT NULL,
  `updatedBy` int DEFAULT NULL,
  `updatedAt` datetime DEFAULT NULL,
  `isDeleted` tinyint NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=737 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
